pub enum Dimensions {
    Empty,
    ZeroDimensional,
    OneDimensional,
    TwoDimensional,
}

pub enum LineIntersection<F: GeoFloat> {
    SinglePoint {
            intersection: Coordinate<F>,
            is_proper: bool,
        },
    Collinear {
            intersection: Line<F>,
        },
}

pub enum Closest<F: GeoFloat> {
    Intersection(Point<F>),
    SinglePoint(Point<F>),
    Indeterminate,
}
